(1, 'Macarrones con tomate', 'Los macarrones con tomate de mi abuela que tanto me han gustado siempre', '- Cocer los macarrones al gusto\r\n- Echar el tomate a los macarrones\r\n\r\nOpcional\r\n- Echar salchichas\r\n- Echar queso rallado y gratinarlo 5 min', 1, 19.64, 12.96, 85.2, 7.98, 23.78, 0, 'imagen en base 64', 2, 1),
