(3, 'Pollo al curry', 'Pollo cocinado en una rica salsa de curry con vegetales', '- Cortar el pollo en trozos\r\n- Saltear la cebolla y el ajo\r\n- Agregar el pollo y cocinar hasta dorar\r\n- Añadir la leche de coco y el curry\r\n- Cocinar a fuego lento hasta que el pollo esté tierno\r\n- Servir con arroz', 1, 31.2, 15.4, 12.9, 5.4, 21.3, 0, 'imagen en base 64', 2, 1),
(4, 'Batido de frutas', 'Batido refrescante con una mezcla de frutas', '- Cortar las frutas en trozos\r\n- Añadir las frutas y el yogur en la licuadora\r\n- Licuar hasta obtener una mezcla homogénea\r\n- Servir frío', 1, 4.2, 1.1, 23.8, 18.6, 29.8, 0, 'imagen en base 64', 2, 1),
(5, 'Sopa de lentejas', 'Sopa nutritiva de lentejas con verduras', '- Remojar las lentejas durante la noche\r\n- Cocinar las lentejas con zanahoria, apio, y cebolla\r\n- Agregar especias al gusto\r\n- Cocinar a fuego lento hasta que las lentejas estén tiernas\r\n- Servir caliente', 1, 12.8, 3.7, 30.4, 4.5, 18.2, 0, 'imagen en base 64', 3, 1),
(6, 'Macarrones con carne y queso gratinado', 'Los macarrones con carne que me ha hecho mi abuela siempre que tanto me gustan', 'Hervir los macarrones al punto y hacer la carne picada con tomate, echarle queso y gratinar', 600, 200, 300, 500, 0, 30, 1000, 'imagen en base 64 no disponible', 5, 1),
